% The purpose of this code is to simulate a predator-prey modelclear;%set the initial dataN =68;P = 10;%set the number of iteratesM = 100;%set the parametersa = 0.95; %parameterY =X+0.6; %Y=number of cinnabar moth eggsX =; %X=ragwort(plant that is predated) biomass%store the initial datan(1) = X;p(1) = Y;%iteratefor j=2:M%evaluate the functions X_new = exp(-a*Y/X);Y_new = X;%store the current valuesn(j) = Y_new;p(j) = X_new;%updateX = X_new;Y = Y_new;end%make some plotsfigure(1)plot([1:M],n,'b',[1:M],p,'r',[1:M],n,'b*',[1:M],p,'r*')figure(2)plot(n,p,'*')